import { backendAPI } from '../../api';

class ConfigServiceImplementation {
  async getConfig() {
    const config = await backendAPI.get('config');
    return config.data;
  }

  async getFullConfig() {
    const config = await backendAPI.get('config/full');
    return config.data;
  }

  async updateConfig(config) {
    await backendAPI.post('config', config);
  }

  async getHealth() {
    const health = await backendAPI.get('health');
    return health.data;
  }

}

export const configService = new ConfigServiceImplementation();
